version = "1.18.0"
authors = ["mechiru <u9053u6d41@gmail.com>"]
edition = "2018"
license = "MIT OR Apache-2.0"
description = "This library generated from googleapis/googleapis using tonic-build."
repository = "https://github.com/mechiru/google-api-proto"
documentation = "https://mechiru.github.io/google-api-proto/google_api_proto/index.html"
categories = ["api-bindings"]
keywords = ["google", "api", "googleapis", "gcloud", "gcp"]
readme = "../README.md"

[package.metadata.release]
pre-release-commit-message = "{{crate_name}}: bump to v{{version}}"
tag-name = "{{crate_name}}/v{{version}}"
